At this point, we have in our interface variable a column representing our counter interface. But if we actually tried to run it, we would quickly find out that something is wrong. Our buttons would be completely disabled. Of course! We have not defined any interactions for them. Notice that we have yet to use our Message enum in our view logic. How is our user interface supposed to produce messages if we don't specify them? Let's do that now. In iced, every widget has a specific type that enables further configuration using simple builder methods. The button helper returns an instance of the Button type , which has an on_press method we can use to define the message it must produce when a user presses the button: use iced::widget::button; let increment = button("+").on_press(Message::Increment);
let decrement = button("-").on_press(Message::Decrement); Awesome! Our interactions are wired up! But there is still a small detail left. A button can be pressed multiple times. Therefore, the same button may need to produce multiple instances of the same Message. As a result, we need our Message type to be cloneable. We can easily derive the Clone trait—as well as Debug and Copy for good measure: #[derive(Debug, Clone, Copy)]
enum Message { Increment, Decrement,
} In The Elm Architecture, messages represent events that have occurred—made of pure data. As a consequence, it should always be easy to derive Debug and Clone for our Message type.

15.body:
We are almost there! There is only one thing left to do: connecting our application state to the view logic. Let's bring together all the view logic we have written so far: use iced::widget::{button, column, text}; // The buttons
let increment = button("+").on_press(Message::Increment);
let decrement = button("-").on_press(Message::Decrement); // The number
let counter = text(15); // The layout
let interface = column![increment, counter, decrement]; If we ran this view logic, we would now be able to press the buttons. However, nothing would happen as a result. The counter would be stuck—always showing the number 15. Our interface is completely stateless! Obviously, the issue here is that our counter variable contains a text widget with a hardcoded 15. Instead, what we want is to actually display the value field of our Counter state. This way, when a button is pressed and our update logic is triggered, the text widget will display the new value. We can easily do this by running our view logic in a method of our Counter—just like we did with our update logic: use iced::widget::{button, column, text}; impl Counter { fn view(&self) { // The buttons let increment = button("+").on_press(Message::Increment); let decrement = button("-").on_press(Message::Decrement); // The number let counter = text(self.value); // The layout let interface = column![increment, counter, decrement]; }
} Our counter variable now will always have a text widget with the current value of our Counter. Great! However, and as you may have noticed, this view method is completely useless—it constructs an interface, but then... It does nothing with it and throws it away! In iced, constructing and configuring widgets has no side effects. There is no "global context" you need to worry about in your view code. Instead of throwing the interface away, we need to return it. Remember, the purpose of our view logic is to dictate the widgets of our user interface; and the content of the interface variable is precisely the description of the interface we want: use iced::widget::{button, column, text, Column}; impl Counter { fn view(&self) -> Column<Message> { // The buttons let increment = button("+").on_press(Message::Increment); let decrement = button("-").on_press(Message::Decrement); // The number let counter = text(self.value); // The layout let interface = column![increment, counter, decrement]; interface }
} Tada! Notice how the view method needs a return type now. The returned type is Column because the column! macro produces a widget of this type—just like button produces a widget of the Button type. You may also have noticed that this Column type has a generic type parameter. This type parameter simply specifies the type of messages the widget may produce. In this case, it takes our Message because the increment and decrement buttons inside the column produce messages of this type. iced has a strong focus on type safety—leveraging the type system and compile-time guarantees to minimize runtime errors as much as possible. And well... That's it! Our view logic is done! But wait... It's a bit verbose right now. Since it's such a simple interface, let's just inline everything: use iced::widget::{button, column, text, Column}; impl Counter { fn view(&self) -> Column<Message> { column![ button("+").on_press(Message::Increment), text(self.value), button("-").on_press(Message::Decrement), ] }
} That's much more concise. It even resembles the actual interface! Since creating widgets just yields values with no side effects; we can move things around in our view logic without worrying about breaking other stuff. No spooky action at a distance! And that's all there is to our counter interface! I am sure you can't wait to run it. Shall we?

