Let's try to get a better understanding of the lifetime of an interface by exploring the internals of a basic (although very magical!) runtime. In fact, we have actually started writing a runtime already! When we implemented the update logic of our counter , we wrote a very small test that simulated a user: #[test]
fn it_counts_properly() { let mut counter = Counter { value: 0 }; counter.update(Message::Increment); counter.update(Message::Increment); counter.update(Message::Decrement); assert_eq!(counter.value, 1);
} This is technically a very bare-bones runtime! It initializes the state , produces some interactions , and executes the update logic . Of course, the interactions are made up, it is very short-lived, and there is no view logic involved—far from what we actually want. Still, it's a great start! Let's try to extend it, step by step.

19.body:
Alright! We have our state initialized. What's next? Well, before a user can interact with our interface, we need to display it to them. That's easy! We just need to open a window in whatever OS the user is running, initialize a proper graphics backend, and then render the widgets returned by our view logic —properly laid out, of course! What? You have no clue of how to do that? Don't worry, I have this magical function: display. It takes a reference to any interface and displays it to the user. It totally works! use magic::display; # // Initialize the state
# let mut counter = Counter::default();
#
// Run our view logic to obtain our interface
let interface = counter.view(); // Display the interface to the user
display(&interface); See? Easy! Jokes aside, the purpose of this chapter is not for us to learn graphics programming; but for us to get a better understanding of how a runtime works. A little bit of magic doesn't hurt!

20.body:
The user is seeing our interface and is now interacting with it! We need to pay very good attention to all the interactions and produce all the relevant messages that our widgets specify. How? With some more magic, of course! I just found this interact function inside of my top hat—it takes an interface and produces the messages that correspond to the latest interactions of the user. use magic::{display, interact}; # // Initialize the state
# let mut counter = Counter::default();
#
# // Run our view logic to obtain our interface
# let interface = counter.view();
# # // Display the interface to the user
# display(&interface);
#
// Process the user interactions and obtain our messages
let messages = interact(&interface); Great! interact returns a list of messages for us—ready to be iterated.

21.body:
At this point, we have gathered the user interactions and we have turned them into a bunch of messages . In order to react properly to the user, we need to update our state accordingly for each message. Luckily, there are no more magic tricks involved in this step—we can just use our update logic : # use magic::{display, interact};
#
# // Initialize the state
# let mut counter = Counter::default();
#
# // Run our view logic to obtain our interface
# let interface = counter.view();
# # // Display the interface to the user
# display(&interface);
#
# // Process the user interactions and obtain our messages
# let messages = interact(&interface);
#
// Update our state by processing each message
for message in messages { counter.update(message);
} That should keep our state completely up-to-date with the latest user interactions.

22.body:
Okay! Our state has been updated to reflect the user interactions. Now, we need to display the resulting interface again to the user. And after that, we must process any further interactions... And then, update our state once more. And then... Do it all over once again! This is a loop! And no, loops aren't very magical—not when we write Rust, at least: use magic::{display, interact}; // Initialize the state
let mut counter = Counter::default(); // Be interactive. All the time! loop { // Run our view logic to obtain our interface let interface = counter.view(); // Display the interface to the user display(&interface); // Process the user interactions and obtain our messages let messages = interact(&interface); // Update our state by processing each message for message in messages { counter.update(message); }
} Congratulations! We just wrote a perfectly functional runtime—magical properties aside. We can clearly understand here how each fundamental part of The Elm Architecture fits in the lifetime of an application. Specifically, state is initialized once, view logic runs once at startup and then after every batch of interactions, and update logic runs for every interaction that created a message .

