"That's cool and all", you say, "but I am not a wizard and I still have no clue of how to run the counter interface I wrote. I have things to count!" Fair enough! iced implements a very similar runtime to the one we just built. It comes bundled with its own magic [1] —so you don't need to worry about learning the dark arts yourself. If we want to run our Counter, all we have to do is call run : # use iced::widget::{button, column, text, Column};
# pub fn main() -> iced::Result { iced::run("A cool counter", Counter::update, Counter::view)
}
# # #[derive(Default)]
# struct Counter {
# value: i64,
# }
# # #[derive(Debug, Clone, Copy)]
# enum Message {
# Increment,
# Decrement,
# }
# # impl Counter {
# fn update(&mut self, message: Message) {
# match message {
# Message::Increment => {
# self.value += 1;
# }
# Message::Decrement => {
# self.value -= 1;
# }
# }
# }
# # fn view(&self) -> Column<Message> {
# column![
# button("+").on_press(Message::Increment),
# text(self.value),
# button("-").on_press(Message::Decrement),
# ]
# }
# } We just give our application a cool title and then provide the update logic and view logic to the runtime —which then figures out the rest! The runtime is capable of inferring the types for the state and messages out of the type signatures of our update logic and view logic . The state is initialized leveraging Default, as we described earlier. Notice also that run can fail and, therefore, it returns an iced::Result . If all we are doing is run the application, we can return this result directly in main. And that should be it! Have fun counting things for 300 million years—at least! Mainly winit , softbuffer , wgpu , tiny-skia , and cosmic-text . Note From the Author You reached the end of the book, for now! I think it should already serve as a quick introduction to the basics of the library. There is a lot more to unravel—but hopefully you are now at a point where you can start playing around, having fun, and experimenting further. The book is far from finished—there are a lot more topics I want to cover here, namely: Layout Styling Concurrency Scaling Applications Extending the Runtime And More! Until I get to write them, check out the Additional Resources chapter if you want to explore and learn further. I hope that you enjoyed the read so far. Stay tuned! — Héctor

