Now, it's time for our update logic —how messages change the state of the application. Basically, we need to write some logic that given any message can update any state of the application accordingly. The simplest and most idiomatic way to express this logic in Rust is by defining a method named update in our application state. For our counter interface, we only need to properly increment or decrement the value of our Counter struct based on the Message we just defined: impl Counter { fn update(&mut self, message: Message) { match message { Message::Increment => { self.value += 1; } Message::Decrement => { self.value -= 1; } } }
} Great! Now we are ready to process user interactions. For instance, imagine we initialized our counter like this: let mut counter = Counter { value: 0 }; And let's say we wanted to simulate a user playing with our interface for a bit—pressing the increment button twice and then the decrement button once. We could easily compute the final state of our counter with our update logic : counter.update(Message::Increment);
counter.update(Message::Increment);
counter.update(Message::Decrement); This would cause our Counter to end up with a value of 1: assert_eq!(counter.value, 1); In fact, we have just written a simple test for our application logic: #[test]
fn it_counts_properly() { let mut counter = Counter { value: 0 }; counter.update(Message::Increment); counter.update(Message::Increment); counter.update(Message::Decrement); assert_eq!(counter.value, 1);
} Notice how easy this was to write! So far, we are just leveraging very simple Rust concepts. No dependencies in sight! You may even be wondering... "Where is the GUI code?!" This is one of the main advantages of The Elm Architecture. As we discovered in the previous chapter, widgets are the only fundamental idea of an interface that is reusable in nature. All the parts we have defined so far are application-specific and, therefore, do not need to know about the UI library at all! The Elm Architecture properly embraces the different nature of each part of a user interface—decoupling state , messages , and update logic from widgets and view logic .
